description:
Tenchi Movie 01:
The demonic space criminal Kain has escaped from prison and destroyed the Galaxy Police headquarters. To ensure that the Jurai will not stop him, Kain travels back to 1970 to eliminate Tenchi's mother before he is even born. Now, Tenchi and the gang must travel to the past to stop him before he ceases to exist. 

Tenchi Movie 02:
A girl, Mayuka, appears one day claiming to be Tenchi's daughter, much to the shock of the Masaki household. Chaos ensues as Washu attempts to discover Mayuka's background, and the girls adjust to the new presence at their home. The result of her appearance reaches back into the past, and puts Tenchi in danger. Tenchi and Ryoko must travel into the realm of a demon called Yuzuha in order to try and set things right, but their task is not an easy one. 

Tenchi Movie 03:
It seems like an ordinary day at the Masaki shrine until Tenchi wanders into the forest and disappears. Six months later, the movie picks up with Ryoko and Ayeka's continuing search for him all over Japan. They discover he is in another world with a strange woman - but they have no idea who she is or how to reach him, or even if he wants to see them again. In the other world, Tenchi strives to capture the image of a woman that keeps coming into his mind. The two worlds finally connect - but to what end, none of them know.

